import React from "react";
// @material-ui/core components
import { makeStyles } from "@material-ui/core/styles";

// @material-ui/icons

// core components
import GridContainer from "components/Grid/GridContainer.js";
import GridItem from "components/Grid/GridItem.js";
import CustomInput from "components/CustomInput/CustomInput.js";
import Button from "components/CustomButtons/Button.js";

import styles from "assets/jss/nextjs-material-kit/pages/landingPageSections/workStyle.js";

const useStyles = makeStyles(styles);

export default function WorkSection() {
  const classes = useStyles();
  return (
    <div className={classes.section}>
      <GridContainer justify="center">
        <GridItem cs={12} sm={12} md={8}>
          <h2 className={classes.title}>アクセス・地図</h2>
          <h4 className={classes.description}>
          </h4>
		  <iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d51797.79033277257!2d139.55238876173885!3d35.766485682960415!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x6018ef972cf893b9%3A0x32a80aa8ab7a3f7a!2sLuna%20Ballet%20Studio!5e0!3m2!1sja!2sjp!4v1577456974752!5m2!1sja!2sjp" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen=""></iframe>
        </GridItem>
      </GridContainer>
    </div>
  );
}
